    backgroundSize: 'cover',
    backgroundRepeat: 'no-repeat',
    backgroundPosition: '50% 60%',
    backgroundSize: 'contain',



  }
  return <Fragment> <div className="slide" style={styles}></div>  <p>{legend}</p> </Fragment>
